// Home page
import React from "react";
import background from "./img/HomePic.png";

function home() {
  return (
    <div style={{ backgroundImage: `url(${background})` ,backgroundSize: '100% 100%',
    backgroundPosition: 'center',
    backgroundRepeat: 'no-repeat',
    minHeight: '100vh' }}>

    </div>
  );
}

export default home;
